request.description:
### Entity Search

This endpoint allows you to retrieve entity information based on the provided query parameters.

#### Request

- Method: GET
- Endpoint: `{{url}}/entity`
- Query Parameters:
  - `q`: The search query parameter to specify the entity and entity type.

#### Response

The response for this request follows the JSON schema below:

```json
{
  "type": "object",
  "properties": {
    "entityName": {
      "type": "string"
    },
    "entityType": {
      "type": "string"
    },
    "entityDetails": {
      "type": "object",
      "properties": {
        // Add properties for entity details if available
      }
    }
  }
}
```

